Unlike Java, Rust supports the asynchronous programming model. There are different async runtimes for Rust, the most popular being Tokio . The other options are async-std and smol . Here's a simple example of how to define an asynchronous function in Rust. The example relies on async-std for the implementation of sleep: use std::time::Duration;
