There are two string types in Rust: String and &str. The former is allocated on the heap and the latter is a slice of a String or a &str. The mapping of those to Java is shown in the following table: Rust Java Note &str String see Note 1. Box<str> String see Note 2. String String String (mutable) StringBuilder see Note 2. There are differences in working with strings in Rust and Java, but the equivalents above should be a good starting point. One of the differences is that Rust strings are UTF-8 encoded, but JVM strings are UTF-16 encoded. Further JVM strings are immutable, but Rust strings can be mutable when declared as such, for example let s = &mut String::from("hello");. There are also differences in using strings due to the concept of ownership. To read more about ownership with the String Type, see the Rust book . Notes: In Rust, &str (pronounced: string slice ) is an immutable string reference type. The Box<str> type in Rust is equivalent to the String type in JVM. The difference between the Box<str> and String types in Rust is that the former stores pointer and size while the latter stores pointer, size, and capacity, allowing String to grow in size. This is similar to the StringBuilder type in JVM once the Rust String is declared mutable. Java: String str = "Hello, World!"; StringBuilder sb1 = new StringBuilder("Hello, World!"); StringBuilder sb2 = new StringBuilder();
sb2.append("Hello"); Rust: let str1: &str = "Hello, World!";
let str2 = Box::new("Hello World!"); let mut sb1 = String::from("Hello World!"); let mut sb2 = String::new();
sb2.push_str("Hello");

