Java lacks native support for String interpolation [1] in comparison to languages like C# . The most common way of implementing string interpolation in Java is by using the format() method from the String class. Here's an example: String name = "John";
int age = 42;
String result = String.format("Person { Name: %s, Age: %d }", name, age); // Alternative using the '+' operator
String result2 = "Person { Name: " + name + ", Age: " + age + " }"; Like Java, Rust does not have a built-in string interpolation feature. Instead, the format! macro is used to format a string. The following example shows how to use string interpolation in Rust: let name = "John";
let age = 42;
let result = format!("Person {{ name: {name}, age: {age} }}"); Custom types can also be interpolated in Java due to the fact that the toString() method is available for each type as it's inherited from Object. public class Person { private String name; private int age; // getters and setters omitted @Override public String toString() { return String.format("Person { Name: %s, Age: %d }", name, age); }
} // Calling from main method
Person person = new Person();
person.setName("John");
person.setAge(42);
System.out.println(person); In Rust, there is no default formatting implemented/inherited for each type. Instead, the std::fmt::Display trait must be implemented for each type that needs to be converted to a string. use std::fmt::*; struct Person { name: String, age: i32,
} impl Display for Person { fn fmt(&self, f: &mut Formatter<'_>) -> Result { write!(f, "Person {{ name: {}, age: {} }}", self.name, self.age) }
} let person = Person { name: "John".to_owned(), age: 42,
}; println!("{person}"); Another option is to use the std::fmt::Debug trait. The Debug trait is implemented for all standard types and can be used to print the internal representation of a type. The following example shows how to use the derive attribute to print the internal representation of a custom struct using the Debug macro. This declaration is used to automatically implement the Debug trait for the Person struct: #[derive(Debug)]
struct Person { name: String, age: i32,
} let person = Person { name: "John".to_owned(), age: 42,
}; println!("{person:?}"); Note: Using the :? format specifier will use the Debug trait to print the struct, where leaving it out will use the Display trait. See also: Rust by Example - Debug Java now has String Templates as a preview feature in Java 21 and Java 22.

