Like Java, Rust has control flow constructs like if expressions, while and for loops. Consider the following code snippet in Java: int number = 50; if (number % 3 == 0) { System.out.println("fizz");
} else if (number % 5 == 0) { System.out.println("buzz");
} else { System.out.println("nothing special...");
} This is the equivalent in Rust: let number = 50; if number % 3 == 0 { println!("fizz");
} else if number % 5 == 0 { println!("buzz");
} else { println!("nothing special...");
} Notice that in Rust we don't have parenthesis around the condition, like in Java. Consider the following while loop in Java: int number = 10; while (number > 0) { System.out.println(number); number--; // or number = number - 1; or number -= 1;
} This is the equivalent in Rust: let mut number = 10; while number > 0 { println!("{}", number); number -= 1; // or number = number - 1;
} Note that number-- doesn't work in Rust. Also, number is declared as mut.

