Rust doesn't have interfaces like those found in Java. It has traits , instead. Similar to an interface, a trait represents an abstraction and its members form a contract that must be fulfilled when implemented on a type. Here's a simple example of an interface in Java: interface Scalable { double scaleLength(); double scaleWidth();
} Here's the equivalent trait definition in Rust: trait Scalable { fn scale_length(&self) -> f64; fn scale_width(&self) -> f64;
} In Java, the Rectangle record (from the previous section on structs ) can implement the Scalable interface as follows: record Rectangle(double length, double width) implements Scalable { // details from previous section omitted @Override public double scaleLength() { return length * 2; } @Override public double scaleWidth() { return width * 2; }
} In Rust, the Rectangle struct (from the previous section on structs ) can implement the Scalable trait as follows: impl Scalable for Rectangle { fn scale_length(&self) -> f64 { self.length * 2 as f64 } fn scale_width(&self) -> f64 { self.width * 2 as f64 }
} Note that in the previous section on structs , we implemented the Display trait for the Rectangle struct. Here's how the Display trait is declared: pub trait Display { // Required method fn fmt(&self, f: &mut Formatter<'_>) -> Result<(), Error>;
} Just the way interfaces can have default methods [1] in Java (where a default implementation body is provided as part of the interface definition), so can traits in Rust. The type implementing the interface/trait can subsequently provide a more suitable and/or optimized implementation if needed. Also, just like in Java interfaces, traits in Rust can define static methods [2] (and even constants). Technically, in Rust these are called associated functions and constants.

