In Java, an interface can extend another interface. Let's say we have an interface called Shape that's declared as follows: interface Shape { // default method default boolean isRectangular() { return true; }
} The Scalable interface can then extend the Shape interface, like so: interface Scalable extends Shape { double scaleLength(); double scaleWidth();
} The Rectangle record that implements the Scalable interface now has access to the default method defined in the Shape interface as well. record Rectangle(double length, double width) implements Scalable { // you have access to the default method defined in the Shape interface.
} Similar behaviour can be achieved in Rust using supertraits and subtraits. Here's the Shape trait: trait Shape { // default method fn is_rectangular(&self) -> bool { true }
} The Scalable trait can then extend the Shape trait, like so: trait Scalable: Shape { fn scale_length(&self) -> f64; fn scale_width(&self) -> f64;
} In this case, Shape is the supertrait while Scalable is the subtrait . Now, any type that implements the Scalable trait must also implement the Shape trait as well (note that this is slightly different from the Java case with interfaces). Here's the Rectangle struct from the previous section on structs . #![allow(dead_code)] use std::fmt::*; struct Rectangle { length: f64, width: f64,
} impl Rectangle { // details from previous section omitted
} impl Scalable for Rectangle { fn scale_length(&self) -> f64 { self.length * 2 as f64 } fn scale_width(&self) -> f64 { self.width * 2 as f64 }
} impl Shape for Rectangle {} We can now invoke the default method defined in the Shape trait as shown below: fn main() { let rect = Rectangle::new(5.2, 4.8); println!("The Shape is a Rectangle: {}", rect.is_rectangular()); // Will print: The Shape is a Rectangle: true
}

