Like Java, Rust types (both enum and struct), can have static and instance-based methods. In Rust-speak, a method is always instance-based and is identified by the fact that its first parameter is named self. The self parameter has no type annotation since it's always the type to which the method belongs. A static method is called an associated function . In the example below, new is an associated function and the rest (length, width and area) are methods of the type: struct Rectangle { length: f64, width: f64,
} impl Rectangle { pub fn new(length: f64, width: f64) -> Self { Self { length, width } } pub fn length(&self) -> f64 { self.length } pub fn width(&self) -> f64 { self.width } pub fn area(&self) -> f64 { self.length() * self.width() }
}

