In Java, it is generally good practice for fields of a type (e.g. a class) to be private. They are then protected/encapsulated by property members with accessor methods (getters and setters) to read or write to those fields. The accessor methods can contain extra logic, for example, to either validate the value when being set or compute a value when being read. Rust only has methods where a getter is named after the field (in Rust method names can share the same identifier as a field) and the setter uses a set_ prefix . Below is an example showing how property-like accessor methods typically look for a type in Rust: struct Rectangle { length: f64, width: f64,
} impl Rectangle { pub fn new(length: f64, width: f64) -> Self { Self { length, width } } // like property getters (each shares the same name as the field) pub fn length(&self) -> f64 { self.length } pub fn width(&self) -> f64 { self.width } // like property setters pub fn set_length(&mut self, val: f64) { self.length = val } pub fn set_width(&mut self, val: f64) { self.width = val } // like computed properties pub fn area(&self) -> i32 { self.length() * self.width() }
}

