When designing a type in Java, it is the responsiblity of the developer to decide whether the type is mutable or immutable. Java does support an immutable design for " data carriers " with record classes. In Rust, mutability is expressed on methods through the type of the self parameter as shown in the example below: struct Point { x: f64, y: f64,
