Higher-order functions are functions that accept other functions as arguments to allow for the caller to participate in the code of the called function. As we've already seen in the code examples above, in both Rust and Java, we can pass closures and lambda expressions to functions. But unlike in Java, Rust also allows regular functions to be passed into other functions: struct Customer { name: String, gross_income: f64,
} impl Customer { pub fn new(name: String, gross_income: f64) -> Self { Self { name, gross_income } } pub fn name(&self) -> String { self.name.clone() } pub fn gross_income(&self) -> f64 { self.gross_income }
} // Note: the parameter func is of type fn, which is a function pointer
