Ownership is arguably one of Rust's most distinctive features. It allows Rust to make memory safety guarantees without needing a garbage collector. In Rust, there can only be one owner of some memory, be that on the stack or heap, at any given time. Rust defines ownership rules that are enforced at compile time: Each value in Rust has a variable that's called it's owner . There can be only one owner at a time. When the owner goes out of scope, the value will be dropped . The Rust compiler assigns lifetimes and tracks ownership. It is possible to pass or yield ownership, which is called moving in Rust. See also: Ownership in Rust. Consider the following Java code that works without any errors: record Point(int x, int y) {} Point p1 = new Point(12, 10);
Point p2 = p1; System.out.println(p1.x() + ", " + p1.y()); // prints: 12, 10
System.out.println(p2.x() + ", " + p2.y()); // prints: 12, 10 Now, let's look at the Rust version (fails with an error): #![allow(dead_code, unused_variables)] struct Point { x: i32, y: i32,
} fn main() { let p1 = Point { x: 12, y: 10 }; // point owned by p1 let p2 = p1; // ownership of point moved to p2 here println!("{}, {}", p1.x, p1.y); // doesn't work, compiler error! println!("{}, {}", p2.x, p2.y); // works fine, prints: 12, 10
} The first statement in main will allocate Point and that memory will be owned by p1. In the second statement, the ownership is moved from p1 to p2 and p1 can no longer be used because it no longer owns anything or represents valid memory. The statement that tries to print the fields of the point via p1 will fail compilation.

