Consider this Rust code: #![allow(dead_code, unused_variables)] #[derive(Debug, PartialEq)]
struct Point { x: i32, y: i32,
} fn main() { let p1 = Point { x: 12, y: 10 }; let p2 = &p1; // p2 takes a reference to the value of p1 assert_eq!(Point { x: 12, y: 10 }, p1); // ok assert_eq!(Point { x: 12, y: 10 }, p2); // fails assert_eq!(Point { x: 12, y: 10 }, *p2); // ok, we use the dereference operator (*) to get the value
