struct Rectangle { length: i32, width: i32,
} impl Rectangle { pub fn new(length: i32, width: i32) -> Self { Self { length, width } } pub fn length(&self) -> i32 { self.length } pub fn width(&self) -> i32 { self.width }
} Here's a function to calculate the area of a rectangle. Notice that we are passing in the Rectangle by value: fn calculate_area(rect: Rectangle) -> i32 { rect.length() * rect.width()
} When we exercise the function as shown below, we get an error. Because we are passing by value , ownership of rect is moved into the calculate_area() function: fn main() { let rect = Rectangle::new(6, 4); let area_of_rect = calculate_area(rect); // value moved into function println!("{}", area_of_rect); // prints: 24 println!("{:?}", rect); // won't work, rect no longer available here
} One (inefficient) solution would be to make Rectangle cloneable : #[derive(Debug, Clone)]
