} fn main() { let rect = Rectangle::new(6, 4); let area_of_rect = calculate_area(rect.clone()); println!("{}", area_of_rect); // prints: 24 println!("{:?}", rect); // works fine, prints: Rectangle { length: 6, width: 4 }
} When we are dealing with a lot of objects, then cloning wouldn't be a great solution. A better approach would be to make the calculate_area() function take a reference to the Rectangle (i.e. &Rectangle) as input. In other words, pass the value by reference . fn calculate_area(rect: &Rectangle) -> i32 { rect.length() * rect.width()
} And now we can use the function as follows: #[derive(Debug)] // no more Clone
struct Rectangle { length: i32, width: i32,
} fn main() { let rect = Rectangle::new(6, 4); let area_of_rect = calculate_area(&rect); // takes a reference as input println!("{}", area_of_rect); // prints: 24 println!("{:?}", rect); // works fine, prints: Rectangle { length: 6, width: 4 }
