} Here's the same code with lifetime annotations: fn main() { let rect1; // -----------+--- 'a // | { // | let rect2 = Rectangle::new(6, 4); // --+-- 'b | rect1 = &rect2; // | | } // --+ | // | println!("{:?}", rect1); // |
} // -----------+ As you can see, the lifetime of rect2 ('b) is shorter than that of rect1 ('a). That's what the error message indicates: borrowed value (&rect2) does not live long enough. Therefore trying to access rect2 after it's been dropped results in a compile-time error. The lifetime annotation 'a is pronounced " tick A ". The Rust compiler has a borrow checker that keeps track of variable lifetimes to determine whether all borrows are valid. The version below works fine: fn main() { let rect2 = Rectangle::new(6, 4); // -----------+--- 'b // | let rect1 = &rect2; // --+-- 'a | // | | println!("{:?}", rect1); // | | //---+ |
} // -----------+ See also: Lifetimes in Rust.

